DROP TABLE IF EXISTS `production_mdesign_procedure`;
CREATE TABLE `production_mdesign_procedure` (
  `id` int NOT NULL AUTO_INCREMENT COMMENT '序',
  `design_id` varchar(50) NOT NULL COMMENT '设计编号',
  `first_kind_id` varchar(50) DEFAULT NULL COMMENT '产品I级分类编号',
  `first_kind_name` varchar(50) DEFAULT NULL COMMENT '产品I级分类名称',
  `procedure_id` varchar(50) NOT NULL COMMENT '工序编号',
  `procedure_name` varchar(50) DEFAULT NULL COMMENT '工序名称',
  `labour_hour_amount` int NOT NULL COMMENT '工时数',
  `procedurce_describe` varchar(400) DEFAULT NULL COMMENT '工序描述',
  `amount_unit` varchar(20) NOT NULL COMMENT '单位',
  `cost_price` int NOT NULL COMMENT '单位工时成本',
  `subtotal` double NOT NULL COMMENT '工时成本小计',
  `module_subtotal` double NOT NULL COMMENT '物料成本小计',
  `register` varchar(50) NOT NULL COMMENT '登记人',
  `register_time` date NOT NULL COMMENT '登记时间',
  `design_module_tag` varchar(20) NOT NULL COMMENT '当前工序物料标志D002-0: 未设计 D002-1: 已设计',
  `design_module_change_tag` varchar(20) NOT NULL COMMENT '当前工序物料变更标志 D003-0: 未变更D003-0: 已变更',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

