-- ----------------------------
-- Table structure for Warehouse_inbound
-- ----------------------------
DROP TABLE IF EXISTS `Warehouse_inbound`;
CREATE TABLE `Warehouse_inbound` (
  `id` int NOT NULL AUTO_INCREMENT COMMENT '序号',
  `inbound_id` varchar(15) DEFAULT NULL COMMENT '入库单编号',
  `storer` varchar(10) DEFAULT NULL COMMENT '入库人',
  `reason` varchar(70) DEFAULT NULL COMMENT '入库理由',
  `amount_sum` int DEFAULT NULL COMMENT '总件数',
  `cost_price_sum` decimal(10,0) DEFAULT NULL COMMENT '总金额',
  `gathered_amount_sum` int DEFAULT NULL COMMENT '确认入库总件数',
  `pemark` varchar(100) DEFAULT NULL COMMENT '备注',
  `register` varchar(10) DEFAULT NULL COMMENT '登记人',
  `register_time` datetime DEFAULT NULL COMMENT '登记时间',
  `checker` varchar(10) DEFAULT NULL COMMENT '复核人',
  `check_time` datetime DEFAULT NULL COMMENT '复核时间',
  `check_tag` varchar(20) DEFAULT NULL COMMENT '审核标志',
  `attemper` varchar(10) DEFAULT NULL COMMENT '调度人',
  `attemper_time` datetime DEFAULT NULL COMMENT '调度时间',
  `store_tag` varchar(20) DEFAULT NULL COMMENT '库存标志',
  PRIMARY KEY (`id`),
  UNIQUE KEY `inbound_id` (`inbound_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

