-- Table structure for Warehouse_stock
-- ----------------------------
DROP TABLE IF EXISTS `Warehouse_stock`;
CREATE TABLE `Warehouse_stock` (
  `id` int NOT NULL AUTO_INCREMENT COMMENT '序号',
  `stock_id` varchar(20) DEFAULT NULL COMMENT '库存编号',
  `product_id` varchar(20) DEFAULT NULL COMMENT '产品编号',
  `product_name` varchar(30) DEFAULT NULL COMMENT '产品名称',
  `first_kind_id` varchar(20) DEFAULT NULL COMMENT '产品一级分类编号',
  `first_kind_name` varchar(50) DEFAULT NULL COMMENT '产品一级分类名称',
  `second_kind_id` varchar(20) DEFAULT NULL COMMENT '产品二级分类编号',
  `second_kind_name` varchar(50) DEFAULT NULL COMMENT '产品二级分类名称',
  `min_amount` int DEFAULT NULL COMMENT '库存报警下限数',
  `max_amount` int DEFAULT NULL COMMENT '库存报警上限数',
  `max_capacity_amount` int DEFAULT NULL COMMENT '最大存储量',
  `amount` int DEFAULT NULL COMMENT '当前存储量',
  `config` varchar(200) DEFAULT NULL COMMENT '配置要求',
  `register` varchar(10) DEFAULT NULL COMMENT '登记人',
  `register_time` datetime DEFAULT NULL COMMENT '登记时间',
  `checker` varchar(10) DEFAULT NULL COMMENT '复核人',
  `check_time` datetime DEFAULT NULL COMMENT '复核时间',
  `check_tag` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '复核标志',
  PRIMARY KEY (`id`),
  UNIQUE KEY `stock_id` (`stock_id`),
  UNIQUE KEY `product_id` (`product_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

